import React from 'react';
import ImageButton from '../../atoms/imageBtn/imageButton';
import './sidebar.css';
import FriendImg from '../../resource/image/friendIcon.png';
import FriendHoverImg from '../../resource/image/friendIconHover.png';
import ChatImg from '../../resource/image/chatIcon.png'
import {BrowserRouter as Router, Route, Link } from 'react-router-dom';
import FriendView from '../../../pages/mainBoard/View/friendView'
import ChatView from '../../../pages/mainBoard/View/chatView'

function Header() : any {
  const btnCss = {
    'padding': '21px'
  }
  return (
    <Router>
      <div className="sidebar">
        <Link to="/friend">
          <ImageButton imageSrc={FriendImg} imageHover={FriendHoverImg} alt={'친구'} css={btnCss} type={'friend'}/>
        </Link>
        <Link to="/chat">
          <ImageButton imageSrc={ChatImg} imageHover={FriendHoverImg} alt={'채팅'} css={btnCss} type={'chat'}/>
        </Link>
      </div>
    
          <Route exact path="/friend" component={FriendView}/>
          <Route exact path="/chat" component={ChatView}/>
    </Router>
  );
}

export default Header;
